package main

import (
	"fmt"
	"time"
)

var arr = []byte{
	'a',
	'e',
	'i',
	'o',
	'u',
}

func findTheLongestSubstring(s string) int {
	result := 0
	splitStr(s, &result)
	return result
}

func splitStr(s string, result *int) {
	mark := true
	for _, c := range arr {
		size, left, right := vowelSizeOfStr(c, s)
		// fmt.Println(size, left, right)
		if size%2 == 1 {
			// 这次的s数据不能进行计算长度，里面有奇数的元音字符
			mark = false
			// 递归分别以两边的元音字符为中心分割的两个字符为参数,如果size=1  则只操作一次
			if size == 1 {
				if left > *result {
					splitStr(s[0:left], result)
				}
				if len(s)-left+1 > *result {
					splitStr(s[left+1:], result)
				}
			} else {
				// 从左边第一个
				if left > *result {
					splitStr(s[0:left], result)
				}
				if len(s)-left+1 > *result {
					splitStr(s[left+1:], result)
				}
				// 从右边第一个
				if right > *result {
					splitStr(s[0:right], result)
				}
				if len(s)-right+1 > *result {
					splitStr(s[right+1:], result)
				}
			}
		}
	}
	if mark == true {
		if *result < len(s) {
			*result = len(s)
		}
	}
}

func vowelSizeOfStr(c byte, s string) (int, int, int) {
	size := 0
	left := len(s)
	right := 0
	for index, row := range s {
		if byte(row) == c {
			if index < left {
				left = index
			}
			if index > right {
				right = index
			}
			size++
		}
	}
	return size, left, right
}

func main() {
	start := time.Now().UnixNano()
	s := ""
	fmt.Println(findTheLongestSubstring(s))
	fmt.Println((time.Now().UnixNano() - start) / 1000000)
}
